defmodule SolutionPartOne do
  def solve(input) do
    {_, regex} = (?a..?z)
    |> Enum.map(fn(x) ->
      letter = <<x :: utf8>>
      letter_upcase = String.upcase(letter)
      "#{letter}#{letter_upcase}|#{letter_upcase}#{letter}"
    end)
    |> Enum.join("|")
    |> Regex.compile()

    simplify(input, regex)
    |> String.length()
  end

  defp simplify(input, regex) do
    simplified_input = Regex.replace(regex, input, "", global: false)

    if String.length(simplified_input) < String.length(input) do
      simplify(simplified_input, regex)
    else
      simplified_input
    end
  end
end

defmodule SolutionPartTwo do
  def solve(input, letters) do
    letters
    |> Enum.map(fn (letter) ->
      input
      |> String.replace(letter, "")
      |> String.replace(String.upcase(letter), "")
      |> SolutionPartOne.solve()
    end)
    |> Enum.min()
  end
end

ExUnit.start()

defmodule SolutionTest do
  use ExUnit.Case

  alias SolutionPartOne, as: PartOne
  alias SolutionPartTwo, as: PartTwo

  test "Part I" do
    assert PartOne.solve("dabAcCaCBAcCcaDA") == 10
  end

  test "Part II" do
    assert PartTwo.solve("dabAcCaCBAcCcaDA", ["a", "b", "c", "d"]) == 4
  end
end

input = ""

IO.puts("Part I")
input
|> SolutionPartOne.solve()
|> IO.puts()

alphabet = Enum.map(?a..?z, fn(x) -> <<x :: utf8>> end)
IO.puts("\nPart II")
input
|> SolutionPartTwo.solve(alphabet)
|> IO.puts()
